15.11 Check grease sys. blade A,B,C (IN)
All fittings in the central lubrication system are checked visually
for leaks. (Blade A, B, C)

18.19 Replace filter in HS brake (CC)&#13;
Replace the filter element in the return
filter (270) - 5 #m. HS brake.

15.02 Measure carbons at blade/hub (CC)&#13;
Measure carbons at blade/hub and replace
if less than 25mm.

15.11 Check grease sys. blade A,B,C (IN)
All fittings in the central lubrication system are checked visually
for leaks. (Blade A, B, C)

21.07 Check carbons, nac bed/tower (IN)&#13;
Measure carbons at nac/tower, replace if
less than 25mm.

22.01 Repl. yaw sys. air filtr (CC)&#13;
Replace the filter element in the air
filter (354) - 3 #m. Yaw station.

22.03 Change hyd oil, yaw (CC)&#13;
Change hydraulic oil on hydraulic
station for yaw brakes.
